class Solution {
    func minOperations(_ nums: [Int], _ k: Int) -> Int {
        var lastIndex = [Int: Int]() // Keeps track of the last index of each element
        for (i, num) in nums.enumerated() {
            lastIndex[num] = i
        }

        // Find the maximum distance from the end for elements 1 through k
        var maxDistance = 0
        for i in 1...k {
            if let index = lastIndex[i] {
                maxDistance = max(maxDistance, nums.count - index - 1)
            }
        }

        // The minimum number of operations is determined by the element that is farthest from the end
        return maxDistance + k // Adding k because we also need to count the operations to collect 1 to k themselves
    }
}
